var clickBool = false;
var chart = null;
var xValues = ["Positive", "Negative"];
var barColors = ["#ACB334","#FF4E11"];

 function initMap() {
    var map = new google.maps.Map(document.getElementById('map'), {
        zoom: 9.5,
        center: {lat: 41.876, lng: -87.624},
        disableDefaultUI: true,
      });


    map.data.loadGeoJson("https://data.cityofchicago.org/api/geospatial/cauq-8yn6?method=export&format=GeoJSON");

    map.data.setStyle((feature) => {
        let color = "red";
        //console.log(feature);
        if (feature.getProperty("isColorful")) {
          color = feature.getProperty("color");
        }
        return /** @type {!google.maps.Data.StyleOptions} */ {
          fillColor: calcColor(feature.getProperty('community')),
          strokeColor: calcColor(feature.getProperty('community')),
          strokeWeight: 2,
        };
      });

      // When the user clicks, set 'isColorful', changing the color of the letters.
      map.data.addListener("click", (event) => {
        event.feature.setProperty("isColorful", true);
        map.data.revertStyle();
        map.data.overrideStyle(event.feature, { strokeWeight: 8 });


        generateChart(event.feature.getProperty("community"))
        exampleMessages(event.feature.getProperty("community"))
        clickBool=!clickBool
      });
      // When the user hovers, tempt them to click by outlining the letters.
      // Call revertStyle() to remove all overrides. This will use the style rules
      // defined in the function passed to setStyle()
      map.data.addListener("mouseover", (event) => {

        if(clickBool === false){
          map.data.revertStyle();
          map.data.overrideStyle(event.feature, { strokeWeight: 8 });


          generateChart(event.feature.getProperty("community"))
          exampleMessages(event.feature.getProperty("community"))


        }

      });
      map.data.addListener("mouseout", (event) => {
        map.data.revertStyle();
      });


  }

  function calcColor(community){
     const json =  TweetsJson
     var hits = 0
     var sum = 0
     for(var i = 0; i < json.length; i++){

       if(json[i].area=== community+"\n"){
         hits+=1
         var mult = 0
         if (json[i].label === "NEGATIVE"){
           mult = -1
         }else{
           mult = 1
         }
         sum+= mult*json[i].score
       }
     }
     sum/= hits
     var color = 0
     if(sum >= 0.4){
       color = "#69B34C"
     }else if(sum >= -0.4){
       color = "#ACB334"
     }else if(sum >= -0.6){
       color = "#FAB733"
     }else if(sum >= -0.9){
       color = "#FF8E15"
     }else{
       color = "#FF4E11"
     }
     return color

  }

  function generateChart(community){
    const json = TweetsJson
    var pos = 0
    var neg = 0
    for(var i = 0; i < json.length; i++){

      if(json[i].area=== community+"\n"){
        if (json[i].label === "NEGATIVE"){
          neg += 1
        }else{
          pos += 1
        }
      }
    }
    if(chart !== null){
      chart.destroy()
    }
    chart = new Chart("myChart", {
        type: "doughnut",
        data: {
            labels: xValues,
            datasets: [{
                backgroundColor: barColors,
                data: [pos,neg],
                borderWidth: 0
            }]
      },
        options: {
            segmentShowStroke: false,
            title: {
                display: true,
                color: "#fff",
                //Change this text for the neighborhood
                text: "Percentage of happy tweets in " + NiceNameFunction(community)
            }
      }
    });
  }

  function NiceNameFunction(CommunityName){
    CommunityName = CommunityName.toLowerCase();
    words = CommunityName.split("_");
    for (let i = 0; i < words.length; i++) {
      words[i] = words[i][0].toUpperCase() + words[i].substr(1);
    }
    return words.join(" ");
  }

  function exampleMessages(community){
    document.getElementById("tweets").innerHTML = ""
    var max = 2
    var count = 0
    const json = TweetsJson

    for(var i = 0; i < json.length; i++){

      if(json[i].area=== community+"\n"){
        document.getElementById("tweets").innerHTML += "<p>" + json[i].text + "</p>"
        count += 1
      }
      if (count > max){
        return count;
      }
    }
  }
